import React, { Fragment } from "react";
import ClientFetch from "../components/Client/ClientFetch";

const Companies = () => {

    return (
        <Fragment>

            <h1>All Companies</h1>
            <ClientFetch requestClient="company" />
        </Fragment>
    )
}
export default Companies
